        )
    }

    const MyPracProps2 = (props) => {
        let {name, age} = props
        return(
            <div>{name}님 안녕하세요. {age}입니다.</div>
        )
    }
    return (
        <div>
            안녕하세요
            <InComponet />
            {
                status ? (<></>) : (<><LoginButton data={buttonClick}/></>)
            }
            <MyPracProps name={"조영현"} age={27}/>
            <MyPracProps2 name={"조영현"} age={27}/>
        </div>
    )
}

export default Start;
